import React, { Component } from 'react';
import intellogo from './../assets/intel.jpg';
import vectorlogo from './../assets/vectorsolutions.jpg';
import uflogo from './../assets/uflogo5.png';
import swamphackslogo from './../assets/swamphacks.jpg';
import magicianlogo from './../assets/magician.png';
import swelogo from './../assets/swelogo.png';
import ufkblogo from './../assets/ufkb.jpg';
import "./../css/layout.css"
import "./../css/default.css"
import "./../css/fonts.css"
import "./../css/magnific-popup.css"
import "./../css/media-queries.css"

class Resume extends Component {
    render() {

        if (this.props.data !== undefined) {
            var skillmessage = this.props.data.skillmessage;
            var education = this.props.data.education.map(function (education) {
                return <div key={education.school}>
                    <h3><img className="education-logo" src={education.imgname == "uflogo" ? uflogo : undefined} alt={education.imgname + "Image"} />{"     " + education.school}</h3>
                    <p className="info">{education.degree} <span>&bull;</span><em className="date">{education.graduated}</em></p>
                    <p>{education.description}</p></div>
            })
            var work = this.props.data.work.map(function (work) {
                return <div key={work.company}>
                    <h3><img className={work.imgname} src={work.imgname == "intel-logo" ? intellogo : (work.imgname == "vector-logo" ? vectorlogo : undefined)} alt={work.imgname + "Image"} /> {work.company}</h3>
                    <p className="info">{work.title}<span>&bull;</span> <em className="date">{work.years}</em></p>
                    <p>{work.description}</p>
                </div>
            })
            var involvement = this.props.data.involvement.map(function(involvement) {
                return <div key={involvement.name}>
                    <h3><img className={involvement.imgname} src={involvement.imgname == "swamphacks-logo" ? swamphackslogo : (involvement.imgname == "magician-logo" ? magicianlogo : (involvement.imgname == "swe-logo" ? swelogo : (involvement.imgname == "ufkb-logo" ? ufkblogo : undefined)))} alt={work.imgname + "Image"} />{involvement.name}</h3>
                    <p className="info">{involvement.title}<span>&bull;</span> <em className="date">{involvement.years}</em></p>
                    <p>{involvement.description}</p>
                </div>
            })
            var skills = this.props.data.skills.map(function (skills) {
                var className = 'bar-expand ' + skills.name.toLowerCase();
                return <li key={skills.name}><span style={{ width: skills.level }} className={className}></span><em>{skills.name}</em></li>
            })
        }

        return (
            <section id="resume">
                <div className="row education">
                    <div className="three columns header-col">
                        <h1><span>Education</span></h1>
                    </div>
                    <div className="nine columns main-col">
                        <div className="row item">
                            <div className="twelve columns">
                                {education}
                            </div>
                        </div>
                    </div>
                </div>

                <div className="row work">
                    <div className="three columns header-col">
                        <h1><span>Work</span></h1>
                    </div>
                    <div className="nine columns main-col">
                        {work}
                    </div>
                </div>

                <div className="row involvement">
                    <div className="three columns header-col">
                        <h1><span>Involvement</span></h1>
                    </div>
                    <div className="nine columns main-col">
                        {involvement}
                    </div>
                </div>

                <div className="row skill">
                    <div className="three columns header-col">
                        <h1><span>Skills</span></h1>
                    </div>
                    <div className="nine columns main-col">
                        <p style={{paddingTop: "8px"}}>{skillmessage}
                        </p>
                        <div className="bars">
                            <ul className="skills">
                                {skills}
                            </ul>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}

export default Resume;
